<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">    
    <title>旋转数组</title>
</head>
<body>        
    <script>
/**
 * @param {number[]} nums
 * @param {number} k
 * @return {void} Do not return anything, modify nums in-place instead.
 */
var containsDuplicate = function(nums) {
    var obj = {}
    for(var i = 0;i<nums.length;i++){
        if(obj[nums[i]] != undefined){
            return true
        }
        obj[nums[i]] = i
    }
    return false
};
console.log(containsDuplicate([1,3,4,1]))
    </script>
</body>
</html>
